description:
Что получится, если связать воедино лаконичную японскую эстетику, вкусные суши и функциональность?

Теперь YaponaMama еще ближе к вам! Закажите суши, роллы и другие полюбившиеся вам блюда всего за несколько кликов!

- подробное меню с фотографиями и описанием блюд;
- отслеживание статуса;
- online-оплата через Uzcard;
- оплата наличными и банковской картой при доставке и самовывозе;
- выбор блюд по ингредиентам;
- быстрый поиск по блюдам в пределах категории;
- прямой вызов в call-центр одним кликом;
- можно указать адрес с помощью геолокации;
- персональный кабинет, где можно просматривать историю заказов и вносить адреса;
- синхронизация заказов между различными устройствами.

Заказывайте доставку на дом или навынос. Смотрите меню с прекрасными фото. Следите за обновлением ассортимента и выгодными акциями.

Мобильное приложение «Yess» поможет:
— Сделать заказ быстро и с мгновенным подтверждением через приложение;
— Получать подарки и кэшбэк с заказов;
— Оплатить заказ бонусными баллами;
— Быть в курсе актуальных акций и скидок.

Присоединяйтесь к нам!
